import React, { useState } from 'react';

import './styles.css'; // Import the CSS file

// Draggable Item Component

const DraggableItem = ({ type, content, onDragStart }) => {

  return (
<div

      draggable

      onDragStart={(e) => onDragStart(e, type, content)}

      className="draggable"
>

      {content}
</div>

  );

};

// DropZone Component

const DropZone = ({ onDrop, elements }) => {

  const handleDrop = (e) => {

    e.preventDefault();

    const data = JSON.parse(e.dataTransfer.getData('application/json'));

    onDrop(data);

  };

  const handleDragOver = (e) => {

    e.preventDefault();

  };

  return (
<div

      onDrop={handleDrop}

      onDragOver={handleDragOver}

      className="drop-zone"
>

      {elements.map((el, index) => (
<div key={index} className="drop-item">

          {el.type === 'text' && <p>{el.content}</p>}

          {el.type === 'image' && <img src="https://placehold.co/100x100" alt="Placeholder" />}

          {el.type === 'button' && <button>{el.content}</button>}

          {el.type === 'link' && <a href="#">{el.content}</a>}
</div>

      ))}
</div>

  );

};

// Template List Component

const TemplateList = ({ templates, onSelectTemplate }) => {

  return (
<div className="template-list">
<h2>Templates</h2>

      {templates.map((template) => (
<div

          key={template.id}

          className="template-item"

          onClick={() => onSelectTemplate(template)}
>

          {template.name}
</div>

      ))}
</div>

  );

};

// Main CMS Component

const CMS = () => {

  const [elements, setElements] = useState([]);

  const [templates, setTemplates] = useState([

    {

      id: 1,

      name: 'Template 1',

      elements: [

        { type: 'text', content: 'Welcome to Template 1' },

        { type: 'button', content: 'Click Me' },

      ],

    },

    {

      id: 2,

      name: 'Template 2',

      elements: [

        { type: 'text', content: 'Welcome to Template 2' },

        { type: 'link', content: 'Go to Site' },

      ],

    },

  ]);

  const handleDragStart = (e, type, content) => {

    e.dataTransfer.setData('application/json', JSON.stringify({ type, content }));

  };

  const handleDrop = (data) => {

    setElements((prevElements) => [...prevElements, data]);

  };

  const handleTemplateSelect = (template) => {

    setElements(template.elements);

  };

  return (
<div className="container">
<h1>CMS Drag-and-Drop Interface</h1>
<div className="flex">
<section className="draggable-items">
<h2>Elements</h2>
<DraggableItem type="text" content="Text" onDragStart={handleDragStart} />
<DraggableItem type="image" content="Image" onDragStart={handleDragStart} />
<DraggableItem type="button" content="Button" onDragStart={handleDragStart} />
<DraggableItem type="link" content="Link" onDragStart={handleDragStart} />
</section>

        <section className="drop-zone-container">
<h2>Drop Zone</h2>
<DropZone onDrop={handleDrop} elements={elements} />
</section>

        <section className="templates">
<TemplateList templates={templates} onSelectTemplate={handleTemplateSelect} />
</section>
</div>
</div>

  );

};

export default CMS;
